  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112228 includes biological,
  chemical, discrete sample, physical and profile data collected from HAKUREI MARU
  in the North Pacific Ocean and South Pacific Ocean from 1993-04-13 to 1993-06-11
  and retrieved during cruise NH93-1 and PACIFICA_49HG19930413. These data include
  ALKALINITY, CHLOROPHYLL A, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE + NITRITE CONTENT (CONCENTRATION), NITRITE, PHOSPHATE, SALINITY,
  SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these data include
  CTD, Coulometer for DIC measurement and bottle. These data were collected by Yutaka
  W. Watanabe and Masashi Arita of National Institute for Resources and Environment
  as part of the PACIFICA_49HG19930413 data set.nnPACIFICA (PACIFic ocean Interior
  CArbon) was an international collaborative project for the data synthesis of ocean
  interior carbon and its related parameters in the Pacific Ocean. The North Pacific
  Marine Science Organization (PICES), Section of Carbon and Climate (S-CC) supported
  the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
